import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      scrollPosition: 0
    }
  }
  componentDidMount() {
    //var $timeline        = $('.timeline');
    const that = this;
    window.addEventListener('scroll', function (e) {
      that.setState({ scrollPosition: document.documentElement.scrollTop })
      console.log("you scrolled", document.documentElement.scrollTop)
    });

  }

  render() {
    const pageOne = (this.state.scrollPosition > document.body.scrollHeight / 20) ? ' openPage' : '';
    const pageTwo = (this.state.scrollPosition > (document.body.scrollHeight / 3)) ? ' closePage' : '';
    return (
      <div className="App">
        <div className={"mainPage mainPage--left" + pageOne}>
        <div id = "particleBackground">
            <Particles  
              params={{
                  "particles": {
                      "number": {
                          "value": 100
                      },
                      "size": {
                          "value": 3,
                      }
                  },
                  "shape": {
                      "type" : "circle",
                  },
                  "interactivity": {
                      "events": {
                          "onhover": {
                              "enable": true,
                              "mode": "repulse"
                          }
                      }
                  }

              }}/>
              <Particles  
              params={{
                  "particles": {
                      "number": {
                          "value": 100
                      },
                      "size": {
                          "value": 3,
                      }
                  },
                  "shape": {
                      "type" : "circle",
                  },
                  "interactivity": {
                      "events": {
                          "onhover": {
                              "enable": true,
                              "mode": "repulse"
                          }
                      }
                  }

              }}/>
            </div>
            <div className="introduction">
            <Typing>
                <p className="nameTitle"> Hello, my name is Tejna Dasari. </p>
                <Typing.Delay ms={1000} />
                <br></br>
                <p className="aboutMe" > I am a rising sophomore at the University of Texas at Austin, majoring in Computer Science and minoring in Business Foundations</p>
            </Typing>
          </div>



        </div>
        <div className={"mainPage mainPage--right" + pageOne}>
        <div id = "particleBackground">
            <Particles  
              params={{
                  "particles": {
                      "number": {
                          "value": 100
                      },
                      "size": {
                          "value": 3,
                      }
                  },
                  "shape": {
                      "type" : "circle",
                  },
                  "interactivity": {
                      "events": {
                          "onhover": {
                              "enable": true,
                              "mode": "repulse"
                          }
                      }
                  }

              }}/>
              <Particles  
              params={{
                  "particles": {
                      "number": {
                          "value": 100
                      },
                      "size": {
                          "value": 3,
                      }
                  },
                  "shape": {
                      "type" : "circle",
                  },
                  "interactivity": {
                      "events": {
                          "onhover": {
                              "enable": true,
                              "mode": "repulse"
                          }
                      }
                  }

              }}/>
            </div>
        </div>
        <div className={"lastPage lastPage--left" + pageTwo}>
        <iframe src="https://docs.google.com/forms/d/e/1FAIpQLSdooNf0ME0sTzznzlDoGeaoj42Z7pVY5wTQ-9jcmH-hVxeVcA/viewform?embedded=true" width="640" height="1261" frameborder="0" marginheight="0" marginwidth="0">Loading...</iframe>
        </div>
        <div className={"lastPage lastPage--right" + pageTwo}>
        <Typing>
           <p className="nameTitle"> Contact me here! </p>
        </Typing>
        </div>
        <div className="secondPage">

          <Timeline></Timeline>

        </div>
      </div>



    );
  }
}

export default App;
